import Vue from 'vue'
import VueRouter from 'vue-router'
import Home from './views/Home.vue'

Vue.use(VueRouter)

var Router = new VueRouter()

export default new Router({
    routes: 
    [
        {
            path:'/',
            name:'home',
            component:Home
        },
        {
            path:'/about',
            name:'about',
            component:()=>import('./views/About.vue')
        }
    ]
})
